import React, { useState } from "react";
import "../mainWindow/window.css";
import logo from "./heisenberg.svg";

export default function RegistrPage() {
  const [form, setForm] = useState({
    email: "",
    password: "",
  });
  return (
    <div className="reg">
      <h1 className="h1">Пожалуйста авторизуйтесь</h1>
      <div className="regContent">
        <div>
          <img className="regLogo" src={logo} />
        </div>
        <div className="input-field">
          <input placeholder="Введите email" id="email" type="text" />
        </div>
        <div className="input-field">
          <input placeholder="Введите пароль" id="password" type="text" />
        </div>
        <div>
          <div className="login button">
            <span>Регистрация</span>
          </div>
          <div className="button register">
            <span>Войти</span>
          </div>
        </div>
      </div>
    </div>
  );
}
